import React from 'react';
import alina from 'assets/img/logo/alina.png';
import logoArquivo from 'assets/img/logo/arquivo.png';
import logoPaper from 'assets/img/logo/paper.png';
import logoCode from 'assets/img/logo/code.png';
import logoDatabase from 'assets/img/logo/database.jpg';
import Box from '@mui/material/Box';
import Button from '@mui/material/Button';
import Card from '@mui/material/Card';
import CardActions from '@mui/material/CardActions';
import CardContent from '@mui/material/CardContent';
import CssBaseline from '@mui/material/CssBaseline';
import Grid from '@mui/material/Grid';
import Typography from 'components/Typography';
import Container from '@mui/material/Container';
import Page from 'components/Page';
import 'styles/components/_database.scss';
import FadeIn from 'components/FadeIn';
import Table, { AvatarCell, SelectColumnFilter, StatusPill } from 'components/Table/Table'

import {
  CardImg,
} from 'reactstrap';
import Row from 'reactstrap/lib/Row';



const DatabasePage = () => {

    const columns = React.useMemo(() => [
        {
          Header: "Name",
          accessor: 'name',

        },
        {
          Header: "Title",
          accessor: 'title',
        },
        {
          Header: "Status",
          accessor: 'status',
          Cell: StatusPill,
        },
        {
          Header: "Age",
          accessor: 'age',

        },
        {
          Header: "Role",
          accessor: 'role',
          Filter: SelectColumnFilter,  // new
          filter: 'includes',
        },
        {
            Header: "Classe",
            accessor: 'label',
            Filter: SelectColumnFilter,  // new
            filter: "inclues",
          },
      ], [])

      const data = [
        {
          name: 'Jane Cooper',
          email: 'jane.cooper@example.com',
          title: 'Regional Paradigm Technician',
          department: 'Optimization',
          status: 'Active',
          role: 'Admin',
          age: 27,
          label: 'estigmatizante',

        },
        {
          name: 'Cody Fisher',
          email: 'cody.fisher@example.com',
          title: 'Product Directives Officer',
          department: 'Intranet',
          status: 'Inactive',
          role: 'Owner',
          age: 43,
          label: 'não-estigmatizante',
        },

      ]

  return (
    <Page>
    <Row >
    <div style={{backgroundColor:"#f9c74f", width:"100%"}}>
        <div className="divTable">
        <Table columns={columns} data={data} />
        </div>



    </div>
    </Row>
    </Page>
  );
}

export default DatabasePage;
